import React from 'react';
import Itemcard from "./Itemcard"; 
import data from "./data";
const Home = () =>{
    
    return (
        <div>
        <h2 className="text-center mt-3">Add more members and be strong the business.....!</h2>
        <section className="py-4 container">
            <div className="row justify-content-center">
                {data.ItemData.map((item,index)=>{
                    return (
                        <Itemcard img={item.img} title={item.title} desc={item.desc} price={item.more} key={index}/>

                    )
                })}
             
            </div>
        </section>
    
            
        </div>

    );
};

export default Home;
